const auth0Domain = 'YOUR_AUTH0_DOMAIN.auth0.com';
const managementToken = pluginVariables['e93a2dfd-9b19-473e-b445-c666fed4e14a']['accessToken'];

const response = await fetch(`https://${auth0Domain}/api/v2/users?per_page=50&page=0`, {
  method: 'GET',
  headers: {
    'Authorization': `Bearer ${managementToken}`,
    'Content-Type': 'application/json'
  }
});

if (!response.ok) {
  throw new Error(`Auth0 API error: ${response.status} ${response.statusText}`);
}

const auth0Users = await response.json();

return auth0Users.map(user => ({
  name: user.name || user.email || 'N/A',
  occupation: user.user_metadata?.occupation || 'N/A',
  location: user.user_metadata?.location || 'N/A'
}));

